import axios from 'axios';

const fetchPumps = async () => {
  try {
    // Make request without specifying the full URL because the proxy will forward it
    const response = await axios.get('/api/pumps');
    console.log(response.data); // Handle the data here
  } catch (error) {
    console.error("Error fetching pumps:", error);
  }
};
